// Protected.js
import React from 'react';
import { Navigate } from 'react-router-dom';
import login from './Login'

function Protected({ isSignedIn, children }) {

  if (!isSignedIn) {
    return <Navigate to="/login" />;
  }
  return children;
}

export default Protected;
